snippet.description:
@SimonSinek  says that leadership is a way of thinking, a way of acting, and most importantly, a way of communicating. It means communicating to those people that you care, that you have what it takes to solve their problem. Leaders inspire others around them and make them believe what they believe, as Dr. Martin Luther King did with his vision of "I have a Dream." In this seminar, Simon Sinek explains what makes a good leader and how you can master the skills of leadership. 

